def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.2:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2)
        elif ratios[i] >= 0.2 and ratios[i] < 0.4:
            priorities[i] = np.tan(item) + np.tan(bins[i])
        elif ratios[i] >= 0.4 and ratios[i] < 0.6:
            priorities[i] = np.log(np.abs(item - bins[i]) + 1)
        elif ratios[i] >= 0.6 and ratios[i] < 0.8:
            priorities[i] = np.arctan(np.sqrt(item * bins[i]))
        else:
            priorities[i] = np.cosh(np.exp(ratios[i])) * np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1)

    for j in range(len(bins)):
        if priorities[j] < 10:
            priorities[j] *= 2
        elif priorities[j] >= 10 and priorities[j] < 20:
            priorities[j] *= 3
        elif priorities[j] >= 20 and priorities[j] < 30:
            priorities[j] /= 2
        else:
            priorities[j] = np.sqrt(priorities[j])

    for k in range(len(bins)):
        if priorities[k] % 2 == 0:
            priorities[k] += item
        else:
            priorities[k] -= item / 2

        if item > 10:
            priorities[k] *= 1.5
        else:
            priorities[k] = np.exp(priorities[k])

    unique_priorities = np.unique(priorities)
    sorted_priorities = np.sort(unique_priorities)[::-1]
    final_priorities = np.zeros_like(priorities)

    for m in range(len(bins)):
        if priorities[m] in sorted_priorities[:3]:
            final_priorities[m] = priorities[m] * 1.2
        else:
            final_priorities[m] = priorities[m] * 0.8

    upper_threshold = np.percentile(final_priorities, 75)
    lower_threshold = np.percentile(final_priorities, 25)

    for n in range(len(bins)):
        if final_priorities[n] > upper_threshold:
            final_priorities[n] *= 1.1
        elif final_priorities[n] < lower_threshold:
            final_priorities[n] *= 0.9

    for p in range(len(bins)):
        if final_priorities[p] < 5:
            final_priorities[p] = final_priorities[p] + np.cos(final_priorities[p])
        else:
            final_priorities[p] = final_priorities[p] * np.sin(final_priorities[p])

    return final_priorities
